// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Storage libraries
library DisputeStorage {
    enum DisputeStatus { Created, UnderReview, InDeliberation, Resolved, Escalated }

    struct Dispute {
        uint256 id;
        uint256 jobId;
        address initiator;
        address respondent;
        string reason;
        DisputeStatus status;
        bool resultDetermined;
        bool fundsReleased;
        address recipient;
        uint256 lockedAmount;
        uint256 createdAt;
        uint256 resolvedAt;
        string evidence;
        string assignedOracle;
        uint256 requiredVotes;
        bool oracleValidated;
    }
}

library SkillStorage {
    enum SkillStatus { Applied, Verified, Rejected }

    struct SkillApplication {
        uint256 id;
        address applicant;
        string skillName;
        string evidence;
        string oracleName;
        SkillStatus status;
        uint256 createdAt;
        uint256 verifiedAt;
    }
}

library QuestionStorage {
    enum QuestionStatus { Asked, Answered, Expired }

    struct Question {
        uint256 id;
        address asker;
        string questionHash;
        string oracleName;
        QuestionStatus status;
        uint256 createdAt;
        uint256 answeredAt;
    }
}

library OracleStorage {
    struct SkillOracle {
        string name;
        string description;
        address[] members;
        bool isActive;
        uint256 createdAt;
        uint256 memberCount;
    }
}

library AthenaOracles {
    struct SkillOracle {
        string name;
        string description;
        address[] members;
        bool isActive;
        uint256 createdAt;
        uint256 memberCount;
    }
}

// Interface definitions
interface IOracleEngine {
    function createOracle(string calldata name, string calldata description) external returns (bool success);
    function addOracleMember(string calldata oracleName, address member) external returns (bool success);
    function removeOracleMember(string calldata oracleName, address member) external returns (bool success);
    function activateOracle(string calldata oracleName) external returns (bool success);
    function deactivateOracle(string calldata oracleName) external returns (bool success);
    function isOracleMember(string calldata oracleName, address member) external view returns (bool isMember);
    function isActive(string calldata oracleName) external view returns (bool);
    function getOracleDetails(string calldata oracleName) external view returns (
        string memory name,
        string memory description,
        address[] memory members,
        bool active,
        uint256 createdAt,
        uint256 memberCount
    );
    function reportMaliciousMember(string calldata oracleName, address member, string calldata evidenceHash) external returns (bool success);
    function isReportedInOracle(string calldata oracleName, address member) external view returns (bool reported);
}

interface INativeDAOGovernance {
    function recordGovernanceAction(address user) external;
    function getGovernanceActions(address user) external view returns (uint256);
    function hasCompletedGovernanceActions(address user, uint256 level) external view returns (bool);
    function canVoteInGovernance(address user) external view returns (bool);
    function getVotingPower(address user) external view returns (uint256);
}

interface IGovernanceActionTracker {
    function recordGovernanceAction(address user) external;
    function getActionCount(address user) external view returns (uint256);
    function hasCompletedActions(address user, uint256 level) external view returns (bool);
    function canParticipateInGovernance(address user) external view returns (bool);
    function getUserGovernanceLevel(address user) external view returns (uint256);
}

interface ICompleteSkillOracleManager {
    function registerSkill(string memory skillName, string memory ipfsHash, uint256 minimumStake) external returns (bool);
    function addOracleMember(string memory skillName, address member, uint256 stakeAmount) external returns (bool);
    function removeOracleMember(string memory skillName, address member) external returns (bool);
    function setOracleActive(string memory skillName, bool active) external returns (bool);
    function isOracleActive(string memory skillName) external view returns (bool);
    function isOracleMember(string memory skillName, address member) external view returns (bool);
    function getOracleMemberCount(string memory skillName) external view returns (uint256);
    function getSkillIpfsHash(string memory skillName) external view returns (string memory);
    function removeStake(string memory skillName, address member, uint256 amount) external;
    function validateOracleForDisputes(string memory oracleName) external view returns (bool isValid);
    function getOracleMemberVotingWeight(string memory oracleName, address member) external view returns (uint256 weight);
    function verifyUserSkill(address user, string memory skillName) external;
    function hasUserSkill(address user, string memory skillName) external view returns (bool);
}

interface IOpenWorkDAO {
    function recordGovernanceAction(address member) external;
    function getVotingPower(address member) external view returns (uint256);
    function canVoteInGovernance(address member) external view returns (bool);
    function registerVerifiedSkill(uint256 userId, uint256 skillId, string memory skillName) external returns (bool);
    function requestConfiscation(address member) external returns (bool);
    function executeConfiscation(address member) external returns (bool);
}

// Cross-chain message structures
struct CrossChainDisputeMessage {
    string action;
    address user;
    uint256 jobId;
    string disputeHash;
    string oracleName;
    uint256 usdtFee;
}

struct CrossChainSkillMessage {
    string action;
    address user;
    string skill;
    string proofHash;
    uint256 usdtFee;
}

struct CrossChainQuestionMessage {
    string action;
    address user;
    string question;
    string contextHash;
    string oracleName;
    uint256 usdtFee;
}

struct CrossChainClaimMessage {
    string action;
    address user;
    uint256 disputeId;
}
